INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (207,'051','나무에서 물고기를 구하고자 함과 같으니 앞길이 막혀서 얻지 못함과 같습니다. 웃음이려다가 도중에서 멈물러서 있고 사람을 얻었다가 오히려 헤어지게 됨과 같습니다. 마음이 정한 바가 없으니 행하는 것이 맹구름과 같습니다.','예비치 않은 의복이 훌연히 당도하여 앞을 가로막으니 암담하기만 합니다. 정월과 이월에는 다른 경영을 놀해서는 안됩니다. 재수는 길함이 있으나 일이 될 듯하다가 뒤에는 흉하게 되니 눈에 보이는 이익에 조심해야 합니다.','가정이 발동하니 이사하지 않으려면 원행이라도 해야 합니다. 그렇지 않으면 우환이 생길 것입니다. 봄철의 재수는 반드시 흉함이 있을 것이니 너무 탐하지 마십시오. 일을 마무리 지을 때 남의 말을 너무 믿지 마십시오. 남의 말만 쫓아서 일을 하다보면 해로움이 있겠습니다.','낙사를 줍고자 하나 때를 잃었으니 가슴에 추수를 하기가 어렵겠습니다. 벽 있는 집을 가까이 하지 마십시오. 자손이 친척할 까 두렵습니다. 비록 재수는 있으나 급하게 서둘러서 얻으려하면 오히려 얻지 못할 것이니 기다려서 얻으십시오.','꿩이 떨어졌으나 역매를 몰지 않았으니 어찌 큰 재물을 얻기를 바라겠습니까. 새 일을 도모하더라도 이루지 못하니 사람들이 화합하지 못하겠습니다. 분수를 지키미 상책이니 다른 경영을 놀하지 마십시오. 새것을 얻고자 함은 이미 때가 아님을 아십시오.','가묘으로 마른해들이 드디어 단비를 만났으니 그 빛이 흰밝고 생기가 나겠습니다. 일을 구하고 도모하면 그 뜻이 여의하여 잘 이루어지고 띠맵의 후회를 하게 되겠습니다. 신수가 대길하고 집안이 화평하니 이때 일을 하지 않는다면 언제 하겠습니까?','초입간 흉할지라도 뒤에는 길하게 되니 길흉이 상반이겠습니다. 이 달의 운수는 횡벽이 분명치 못하니 매사에 정직을 기해야 합니다. 멀리 떠나면 불리하고 집에 있으면 길하니 이를 함부로 도모하지 말고 자신을 지켜나감이 옳겠습니다.','만약에 손재수가 없다면 관재나 구설수가 있을 것이니 미리 방지하십시오. 재앙을 미리 막으려면 이사를 하거나 하던 일을 잠시 바꾸어 봄도 좋겠습니다. 비록 재수는 있으나 초입은 길하고 뒤에는 흉하기 쉬우니 재수가 있을 때 잘 지켜야 합니다.','관신삼이 문에 비치니 자손을 조심하십시오. 집안 사람이 떠나게 되거나 사귀던 사람과 헤어지게 되니 마음이 무량고 섭섭합니다. 이 달의 운수는 흉함이 많고 길함이 적으니 마음을 가라앉혀 매사에 선부러 웃음이지 않는 것이 상책입니다.','9월과 10월에는 자식을 낳거나 사람을 더 늘리게 될 운수입니다. 재성이 집에 비치니 의외의 재물을 얻어 기쁘게 되겠습니다. 9월의 단풍이 물들었으니 더 아름다움을 느낄 것이니 그만큼 기쁜 일이 도래하게 되겠습니다.','해로운 것은 반드시 동쪽과 북쪽 양방에 있으니 일을 시작하기 전과 시작할 때를 조심하십시오. 실행하여 멀리 나가면 불리하고 집에 있으면 길하니 일을 바이지 말고 가정을 지키미 좋겠습니다. 이익은 서쪽과 남쪽 사이에 있으며 일을 마무리 짓는데 열심해야겠습니다.','재물이 북방에서 생길 것으로 보이며 일을 마무리 짓고 난 뒤에 얻게 될 것입니다. 편안한 몸과 마음으로 여유 있게 생활하시길 바랍니다. 다만 사람을 잘 못 사귐으로 해서 해를 입을지도 모르니 대인관계를 조심하십시오','건강도 왕성하고 재물도 왕성하니 한 집안이 태평하겠습니다. 그렇다고 다른 일을 도모하여 새로운 경영을 놀한다면 기쁨이 줄어들 것입니다. 관인이 나타나 도왔주니 띠맵의 성공을 하게 됩니다. 서둘러 일을 바이지 말고 기다림이 좋겠습니다.','2025-03-02 11:59:25.488682+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (420,'051','它与您想从树上拿一条鱼一样，因此由于道路被封锁而无法获得。就像笑着，停下来，找人并分手。由于没有智力，它就像云云。','前所未有的衣服被浸入前面并被阻塞。不要在新年和结转中进行其他管理层。幸运的是很长，但这似乎是一项工作，但是之后，您应该谨慎对待可见的好处。','家庭是触发的，因此，如果您不想搬家，则必须运行。否则，您将能够发展。不要垂涎太多，因为春天的运气必须丑陋。完成工作后，不要相信别人太多。追逐他人后工作是有害的。','很难在胸部收获，因为我损失了一次跌倒。不要关闭墙壁的墙壁。恐怕后代将是亲戚。即使您很着急，如果您想着急，也不会得到它。','野鸡已经下降，但没有驱动泄漏，那么您想如何获得大财富？即使您做新事物，人们也将无法协调。不要玩其他管理，因为它在喷泉中很棒。知道您已经想得到一个新的。','瘦年终于遇到了丹比，所以光将是白色而活泼的。如果您寻求和促进工作，含义将做得很好，您会后悔的是Tigade Map。当Shin -Soo漫长而房子很宁静时，如果您不工作，您什么时候会这样做？','即使对于一开始很丑，它也会很长。这个月的运气不清楚，因此您必须诚实。如果您离开遥远，那是不利的，如果您在家，您将无法做到。','如果您没有任何敏捷性，将会有一个老人或傻瓜。为了预先防止灾难，更改您暂时移动或所做的事情将是很不错的。尽管很幸运，但入口在后面很丑陋。','小心您的后代，因为甘斯曼人在门口。我为我的家人感到难过，因为我会与离开或爆发的人分手。这个月的运气有很多丑陋和少量的长度，因此最好不要嘲笑一切。','在9月和10月，您将有孩子或增加人。由于财富在家，我很乐意获得意外的财富。 9月的秋叶已经涂色，所以我会感到更加美丽。','有害的事情必须在东方和北部，因此在开始和开始之前和何时要小心。如果您跑步并走得很远，那是一个劣势，如果您在家，那将是很长的。利润是在西方和南方之间的，我们必须热心完成工作。','似乎财富将在北部发生，并在完成工作后获得。我希望您生活在轻松的身心。但是，请注意人际关系，因为您可能会伤害人们，因为他们不擅长研究金。','健康是有活力的，财富很强大，因此一个家庭会和平。但是，如果您通过推广其他事情来发挥新的管理，那么欢乐将减少。关恩（Kwan）出现并帮助了他。我想尽快等待。','2025-03-02 11:59:25.488682+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (491,'051','木から魚を手に入れたいのと同じので、道路がブロックされているため、取得されません。それは笑って、途中で立ち止まって、人を獲得し、別れたようなものです。心がないので、それは雲の雲のようなものです。','前例のない服は正面に浸され、ブロックされています。新年とキャリーオーバーで他の管理をプレイしないでください。ラッキーは長いですが、それは仕事のようですが、その後、目に見える利点に注意する必要があります。','家族はトリガーされているので、動きたくない場合は走らなければなりません。それ以外の場合は、開発できるようになります。春の運は醜いので、あまり切望しないでください。仕事を終えたら、他の人をあまり信じないでください。他の人を追いかけた後に働くことは有害です。','私は転倒を拾うために一度失ったので、胸で収穫することは困難です。壁の壁を閉じないでください。子孫が親relativeになるのではないかと心配しています。あなたが急いでいるとしても、あなたが急いで行きたいなら、あなたはそれを手に入れません。','キジは倒れましたが、漏れを駆り立てませんでしたが、どうやって大きな富を得たいですか？たとえあなたが新しいことをしたとしても、人々は調和することはできません。噴水で優れているため、他の管理をプレイしないでください。すでに新しいものを手に入れたいことを知ってください。','スキニー年はついにダンビに会ったので、光は白くて活気があります。仕事を求めて宣伝すると、意味がうまく行われ、Tigadeマップを後悔します。シンが長く、家が平和であるとき、あなたが働いていなければいつそれをしますか？','最初は醜いとしても、それはその背後に長くなります。今月の運は明確ではないので、あなたはすべてに正直でなければなりません。遠く離れている場合、それは不利であり、あなたが家にいる場合、あなたはそれをすることができません。','器用さがない場合、老人や吸盤があります。事前に災害を防ぐために、あなたが動いていたことやしばらくの間何をしていたかを変えるのはいいことです。幸運ですが、入り口は長く、後ろにいます。','ガンマンがドアにいるので、あなたの子孫に注意してください。私は家族を気の毒に思います。なぜなら、私は去ったり勃発したりする人と別れます。今月の運には多くのugさと長さがほとんどないので、すべてを笑わないことが最善です。','9月と10月には、子供がいるか、人を増やします。富が家にいるので、私は予想外の富を得ることができてうれしいです。 9月の秋の葉が色付けされているので、私はもっと美しいと感じます。','有害なものは東と北の両方にある必要がありますので、開始して開始する前と開始時に注意してください。あなたが走って遠くに行くなら、それは不利であり、あなたが家にいるなら、それは長くなるでしょう。利益は西と南の間であり、私たちは仕事を終えるために熱心でなければなりません。','富は北部で発生し、作業を終えた後に得られるようです。リラックスした体と心と一緒に暮らすことを願っています。ただし、交わりが得意ではないので、人々を傷つけている可能性があるため、対人関係に注意してください。','健康は活発で、富は強いので、家族は平和になります。ただし、他のことを促進することで新しい管理を行うと、喜びが減ります。クワンが現れて彼を助けました。できるだけ早く待ちたいです。','2025-03-02 11:59:25.488682+00','j');
